require('dotenv').config();

export const API = process.env.REACT_APP_API_URL;

export const getCrashes = () => {
    return fetch(`${API}/crash`, {
        method: "GET"
    })
        .then(response => {
            console.log("react get crashes")

            console.log(API)
            return response.json();
        })
        .catch(err => console.log(err));
};
